import sys

class Node:
    def __init__(self, label):
        self.label = label
        self.children = []

    def addChild(self, child):
        self.children.append(child)

    def hasChild(self, child):
        return child in self.children


class Graph:
    def __init__(self, vertices, edges):
        self.vertices = []
        self.edges = []

        for v in vertices:
            self.vertices.append(Node(v))

        for e in edges:
            edge = (e[0], e[1])
            self.edges.append(edge)
            self.vertices[e[0] - 1].addChild(self.vertices[e[1] - 1])
            self.vertices[e[1] - 1].addChild(self.vertices[e[0] - 1])

    def bfs(self):
        visited = [False] * len(self.vertices)
        queue = [0]
        visited[0] = True
        while len(queue) > 0:
            currentNode = queue.pop(0)
            for child in self.vertices[currentNode].children:
                if not visited[child.label - 1]:
                    queue.append(child.label - 1)
                    visited[child.label - 1] = True

        for i in range(len(visited)):
            if not visited[i]:
                return False

        return True

