from typing import List

class Solution:
    def is_palindrome(self, arr: List[int]) -> bool:
        # rows
        for i in range(len(arr)):
            if arr[i]!= arr[len(arr) - 1 - i]:
                return False
        # columns
        for i in range(len(arr)):
            if arr[i]!= arr[i * len(arr) // len(arr)]:
                return False
        return True

    def solution(self, n: int, arr: List[int]) -> str:
        if not n:
            return 'NO'
        arr.sort()
        arr.reverse()
        for i in range(len(arr)):
            if self.is_palindrome(arr[:len(arr) - i]):
                return''.join(str(x) for x in arr[:len(arr) - i])
        return 'NO'

