import sys


class Matrix:
    def __init__(self, row_num, col_num):
        self.row_num = row_num
        self.col_num = col_num
        self.matrix = self.create_matrix()

    def create_matrix(self):
        matrix = []
        for row_index in range(self.row_num):
            row = list(map(int, input().split()))
            matrix.append(row)
        return matrix

    def invert_row(self, row_index):
        matrix = self.matrix
        row = matrix[row_index]
        row_size = len(row)
        for col_index in range(row_size):
            row[col_index] = 1 - row[col_index]
        return matrix

    def invert_col(self, col_index):
        matrix = self.matrix
        col = [row[col_index] for row in matrix]
        for row_index in range(self.row_num):
            matrix[row_index][col_index] = 1 - col[row_index]
        return matrix

    def print_matrix(self):
        matrix = self.matrix
        for row in matrix:
            print(" ".join(map(str, row)))

    def is_sorted(self):
        return False

    def solve(self):
        if self.is_sorted():
            return "YES"

        for row_index in range(self.row_num):
            for col_index in range(self.col_num):
                matrix = self.matrix
                if row_index == 0:
                    if matrix[row_index][col_index] == 1:
                        matrix = self.invert_row(row_index)
                else:
                    if matrix[row_index][col_index] == 1:
                        matrix = self.invert_col(col_index)
                self.print_matrix()
                if self.is_sorted():
                    return "YES\n{}\n{}".format(
                        "".join(map(str, [1 if row[col_index] == 1 else 0 for row in matrix])),
                        "".join(map(str, [1 if col[row_index] == 1 else 0 for col in zip(*matrix)]))
                    )

        return "NO"

