import sys

class AtCode:
    def __init__(self, test_cases):
        self.test_cases = test_cases
        self.in_file, self.out_file = sys.stdin, sys.stdout

    def read(self):
        return self.in_file.readline()

    def write(self, string):
        return self.out_file.write(string)

    def solve(self):
        self.D, self.G = map(int, self.read().split())

        self.p_c = []
        for i in range(self.D):
            self.p_c.append(list(map(int, self.read().split())))

        self.total_points = 0
        for i, c in enumerate(self.p_c):
            self.total_points += (c[0] + c[1]) * (100 ** i)

        self.p = []
        for i, c in enumerate(self.p_c):
            for j in range(c[0]):
                self.p.append(c[0] * 100 ** i + j)

        self.c = []
        for i in range(self.D):
            self.c.append(self.p_c[i][2])

        self.ans = 0
        for i in self.p:
            if i >= self.G:
                self.ans += 1
        return self.ans

    def main(self):
        for t in self.test_cases:
            self.in_file = open(t[0])
            self.out_file = open(t[1], 'w')
            result = self.solve()
            self.write(str(result) + '\n')

