class Solution:
    # Time complexity: O(NlogB)
    # Space complexity: O(1)
    def solution_one(self, n: int, m: int, prices: List[int], counts: List[int]) -> int:
        if n <= 0:
            return 0

        prices = sorted(zip(prices, counts))
        result = 0

        for price, count in prices:
            result += price * count
            if result > m:
                return result - price * (count - 1)

        return m - result

