from collections import deque


class Stack:
    def __init__(self):
        self._container = deque()

    @property
    def empty(self):
        return len(self._container) == 0

    def push(self, element):
        self._container.append(element)

    def pop(self):
        return self._container.pop()

    def __repr__(self):
        return repr(self._container)


class Node:
    def __init__(self, data):
        self.data = data
        self.right_child = None
        self.left_child = None


class BinarySearchTree:
    def __init__(self):
        self.root = None

    def insert(self, data):
        new_node = Node(data)
        if self.root is None:
            self.root = new_node
            return
        curr_node = self.root
        while True:
            if data >= curr_node.data:
                if curr_node.right_child is None:
                    curr_node.right_child = new_node
                    return
                curr_node = curr_node.right_child
            elif data < curr_node.data:
                if curr_node.left_child is None:
                    curr_node.left_child = new_node
                    return
                curr_node = curr_node.left_child

    def lookup(self, data):
        curr_node = self.root
        while curr_node is not None:
            if data == curr_node.data:
                return data
            elif data > curr_node.data:
                curr_node = curr_node.right_child
            else:
                curr_node = curr_node.left_child
        return False

    def remove(self, data):
        node = self.root
        parent_node = None
        while node is not None and node.data!= data:
            parent_node = node
            if data > node.data:
                node = node.right_child
            elif data < node.data:
                node = node.left_child
        if node is None:
            return
        if node.left_child is not None and node.right_child is not None:
            min_node = node.right_child
            while min_node.left_child is not None:
                min_node = min_node.left_child
            node.data = min_node.data
            node = min_node
        if parent_node is None:
            self.root = node
        elif parent_node.left_child == node:
            parent_node.left_child = node
        elif parent_node.right_child == node:
            parent_node.right_child = node
        else:
            node.data = parent_node.data

    def breadth_first_search(self, data):
        curr_node = self.root
        curr_node_stack = Stack()
        curr_node_stack.push(curr_node)
        while not curr_node_stack.empty:
            curr_node = curr_node_stack.pop()
            if curr_node.data == data:
                return True
            if curr_node.right_child is not None:
                curr_node_stack.push(curr_node.right_child)
            if curr_node.left_child is not None:
                curr_node_stack.push(curr_node.left_child)
        return False

    def in_order(self, node, array):
        if node is None:
            return
        self.in_order(node.left_child, array)
        array.append(node.data)
        self.in_order(node.right_child, array)

