class Solution:
    def __init__(self) -> None:
        self.max_pair_count = 0
        self.left_boots_count = 0
        self.right_boots_count = 0
        self.compatibilities = []
        self.left_boots = []
        self.right_boots = []
        self.left_right_dict = dict()
        self.right_left_dict = dict()

    def solution(self, stdin: str) -> None:
        self.get_data(stdin)
        self.create_compatibilities_dictionary()
        self.iterate_through_all_compatible_combinations()
        print(self.max_pair_count)
        self.print_result()

    def get_data(self, stdin: str) -> None:
        self.left_boots_count, self.right_boots_count = [
            int(x) for x in stdin.strip().split("\n")[0].split()
        ]
        self.left_boots = stdin.strip().split("\n")[1].split()
        self.right_boots = stdin.strip().split("\n")[2].split()

    def create_compatibilities_dictionary(self) -> None:
        self.left_right_dict = {}
        for left_boot in self.left_boots:
            self.left_right_dict.setdefault(left_boot, {})

            for right_boot in self.right_boots:
                self.left_right_dict[left_boot].setdefault(right_boot, 0)
                self.left_right_dict[left_boot][right_boot] += 1

        self.right_left_dict = {}
        for right_boot in self.right_boots:
            self.right_left_dict.setdefault(right_boot, {})

            for left_boot in self.left_boots:
                self.right_left_dict[right_boot].setdefault(left_boot, 0)
                self.right_left_dict[right_boot][left_boot] += 1

    def iterate_through_all_compatible_combinations(self) -> None:
        for left_boot in self.left_boots:
            for right_boot in self.right_boots:
                if self.check_if_compatible(left_boot, right_boot):
                    if left_boot in self.left_right_dict and right_boot in self.left_right_dict[left_boot]:
                        self.count_compatible_left_right_combination()
                    elif right_boot in self.right_left_dict and left_boot in self.right_left_dict[right_boot]:
                        self.count_compatible_right_left_combination()

    def count_compatible_left_right_combination(self) -> None:
        self.max_pair_count += 1
        self.compatibilities.append((self.left_boots.index(left_boot), self.right_boots.index(right_boot)))

    def count_compatible_right_left_combination(self) -> None:
        self.max_pair_count += 1
        self.compatibilities.append((self.right_boots.index(right_boot), self.left_boots.index(left_boot)))

    def check_if_compatible(self, left_boot: str, right_boot: str) -> bool:
        if left_boot == right_boot or left_boot == "?":
            return True
        elif right_boot == "?":
            return left_boot!= "?"
        else:
            return False

    def print_result(self) -> None:
        print(self.max_pair_count)
