from collections import defaultdict

class Graph:
    def __init__(self, n):
        self.size = n
        self.edges = []
        self.graph = [[] for _ in range(n)]

    def addEdge(self, source, dest):
        self.graph[source].append(dest)
        self.graph[dest].append(source)
        self.edges.append((source, dest))

    def dfs(self, source, visited, component):
        visited[source] = True
        for neighbour in self.graph[source]:
            if visited[neighbour] == False:
                self.dfs(neighbour, visited, component)
        component.append(source)

    def countComponents(self):
        components = []
        visited = [False] * self.size
        for node in range(self.size):
            if visited[node] == False:
                component = []
                self.dfs(node, visited, component)
                components.append(component)
        return len(components)

    def findClusters(self):
        components = self.countComponents()
        clusters = []
        for component in components:
            cluster = {}
            for node in component:
                cluster[node] = []
                for edge in self.edges:
                    if edge[0] == node:
                        cluster[node].append(edge[1])
                    if edge[1] == node:
                        cluster[node].append(edge[0])
            clusters.append(cluster)
        return clusters

