import sys
from collections import defaultdict
from typing import Dict, List, Tuple, Union


class Solution:
    def solve(self, stdin: str) -> int:
        n, m, k = list(map(int, stdin.split('\n')[0].split(' ')))
        districts = self.read_districts(stdin)
        self.read_road(n, m, districts, stdin)
        return self.dijkstra(k, districts)

    def read_districts(self, stdin: str) -> Dict[int, int]:
        districts = defaultdict(list)
        for district in stdin.split('\n')[1:]:
            a, b, cost = list(map(int, district.split(' ')))
            districts[a].append((b, cost))
            districts[b].append((a, cost))
        return districts

    def read_road(self, n: int, m: int, districts: Dict[int, List[Tuple[int, int]]], stdin: str):
        for i in range(m):
            a, b, cost = list(map(int, stdin.split('\n')[i + 1].split(' ')))
            districts[a].append((b, cost))
            districts[b].append((a, cost))

    def dijkstra(self, k: int, districts: Dict[int, List[Tuple[int, int]]]) -> int:
        def dfs(start: int, parent: int = None, cost: int = 0) -> int:
            for neighbour, ncost in districts[start]:
                if neighbour == parent:
                    continue
                dist[neighbour] = min(dist[neighbour], cost + ncost)
                dfs(neighbour, start, cost + ncost)

        dist = [float('inf')] * (n + 1)
        dfs(1)
        return sum([cost for neighbour, cost in districts[k] if dist[neighbour]!= float('inf')])

