from __future__ import annotations

import sys
import functools


@functools.total_ordering
class MinPerm:
    def __init__(self, perm: list[int]) -> None:
        self.perm = perm
        self.size = len(perm)

    def __repr__(self) -> str:
        return f"{type(self).__name__}({self.perm})"

    def __eq__(self, other: MinPerm) -> bool:
        return self.perm == other.perm

    def __lt__(self, other: MinPerm) -> bool:
        return (
            self.size < other.size
            or self.size == other.size
            and self.perm < other.perm
        )


@functools.total_ordering
class MinPermSub:
    def __init__(self, perm: list[int], i: int, j: int) -> None:
        self.perm = perm
        self.size = len(perm)
        self.i = i
        self.j = j

    def __repr__(self) -> str:
        return f"{type(self).__name__}({self.perm}, {self.i}, {self.j})"

    def __eq__(self, other: MinPermSub) -> bool:
        return self.perm == other.perm

    def __lt__(self, other: MinPermSub) -> bool:
        if self.size!= other.size:
            return self.size < other.size
        elif self.perm!= other.perm:
            return self.perm < other.perm
        else:
            return self.i < other.i

