from typing import List

class Matrix:
    def __init__(self, matrix_data):
        self.data = matrix_data

    def __str__(self):
        return '\n'.join(['\t'.join([str(el) for el in row]) for row in self.data])

    def __getitem__(self, key):
        return self.data[key]

    def __add__(self, other):
        return Matrix([
            [self[row][col] + other[row][col] for col in range(len(self[row]))] for row in range(len(self))
        ])

    def __mul__(self, other):
        if isinstance(other, Matrix):
            return Matrix([
                [sum([self[row][col] * other[row][col] for col in range(len(self[row]))]) for row in range(len(self))]
            ])
        else:
            return Matrix([
                [self[row][col] * other for col in range(len(self[row]))] for row in range(len(self))
            ])

    def __sub__(self, other):
        return Matrix([
            [self[row][col] - other[row][col] for col in range(len(self[row]))] for row in range(len(self))
        ])

    def transpose(self):
        return Matrix([
            [self[col][row] for col in range(len(self))] for row in range(len(self[0]))
        ])

    def determinant(self):
        if len(self) == 1:
            return self[0][0]
        if len(self) == 2:
            return self[0][0] * self[1][1] - self[0][1] * self[1][0]
        else:
            determinant = 0
            for col in range(len(self)):
                determinant += self[0][col] * self.cofactor(0, col).determinant() * (-1) ** col
            return determinant

    def minor(self, i, j):
        return self.submatrix(i, j).determinant()

    def submatrix(self, i, j):
        if len(self) == 1:
            return Matrix([[self[0][0]]])
        elif len(self) == 2:
            return Matrix([[self[0][0], self[0][1]], [self[1][0], self[1][1]]])
        return Matrix([
            [self[row][col] for col in range(len(self)) if col!= j] for row in range(len(self)) if row!= i
        ])

    def cofactor(self, i, j):
        if len(self) == 1:
            return 1
        return self.minor(i, j) * (-1) ** (i + j)

    def inverse(self):
        determinant = self.determinant()
        if determinant == 0:
            return Matrix([[0] * len(self) for _ in range(len(self))])
        cofactor_matrix = Matrix([
            [self.cofactor(i, j) for j in range(len(self))] for i in range(len(self))
        ])
        return cofactor_matrix * (1 / determinant)

