S, C, K = [int(c) for c in stdin.readline().split()]
D = [int(c) for c in stdin.readline().split()]

from collections import defaultdict

d = defaultdict(lambda: [])

for i in range(S):
    d[D[i]].append(i + 1)

import heapq

heap = []
for i in d.keys():
    heapq.heappush(heap, -i)

curr_cap = 0
ans = 0
while heap:
    i = heapq.heappop(heap)
    if curr_cap + 1 < C:
        ans += 1
        curr_cap += 1
    else:
        i = -i
        if K + i in d.keys():
            for j in d[K + i]:
